  content: {"id": 1, "value": "<p><a href=\"http://fab-manager.com\" target=\"_blank\">Fab-manager</a> est outil de gestion des atelier de fabrication numérique, permettant de réserver des machines de découpe, des imprimantes 3D, etc. tout en gérant simplement les aspect financier, comptable et statistiques de votre espace.</p><p><a href=\"http://fab-manager.com\" target=\"_blank\">Fab-manager</a> est un projet libre: ouvert à tous, il offre la possibilité de contribuer soi-même au code, de télécharger le logiciel, de l'étudier et de le redistribuer. Vous n''êtes pas technicien ? Vous pouvez quand même participer à <a href=\"https://translate.fab-manager.com/\">traduire Fab-manager dans votre langue</a>.</p><p> Fab-manager favorise le partage de connaissances grâce au réseau OpenLab: les projets que vous documentez sont partagés avec l''ensemble du réseau des Fab-managers.</p>",
